public static double erf(double x1, double x2){
    if (x1 > x2) {
        return -erf(x2, x1);
    }
    return x1 < -X_CRIT ? x2 < 0.0 ? erfc(-x2) - erfc(-x1) : erf(x2) - erf(x1) : x2 > X_CRIT && x1 > 0.0 ? erfc(x1) - erfc(x2) : erf(x2) - erf(x1);
}

